import React from "react";
import { YMaps } from "react-yandex-maps";

const About = () => {
  return (
    <YMaps>
      <div>My awesome application with maps!</div>
      <Map defaultState={{ center: [55.75, 37.57], zoom: 9 }} />
    </YMaps>
  );
};

export default About;
